import React from 'react'
import fetch from 'node-fetch'

const MainComponent = (props) => {
  console.log({props});
  return (
    <div>Hello world!</div>
  )
}

MainComponent.getInitialProps = async () => {
  fetch("https://www.goodreads.com/search.xml?key=P89RUgLvpIk3VVqzk54Kcw&q=Ender%27s+Game")
    .then(res => res.text())
    .then(body => {

      return {
        info: body
      }
    });
}

export default MainComponent
